// src/components/Header.js
import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="logo">Logo</div>
      <nav>
        <ul>
          <li>MY 강의</li>
          <li>학습노트</li>
          <li>퀴즈</li>
          <li>로드맵</li>
          <li>커뮤니티</li>
          <li>마이페이지</li>
        </ul>
      </nav>
      <div className="auth-buttons">
        <button>로그인</button>
        <button>회원가입</button>
      </div>
    </header>
  );
};

export default Header;
